import PokemonsDetail from './pages/pokemon-detail';
function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Navbar />
      <div className="pages">

<Routes>
  <Route path="/" element={<Home />} />
  <Route path="/${id}" element={<PokemonsDetail />} />


</Routes>

      </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
